import React from 'react';
import { useParams } from 'react-router-dom';

const DetailPost = ({ data }) => {
  const { id } = useParams();
  const post = data.find(post => post.id === id);

  return (
    <div>
      <h2>{post.title}</h2>
      <p>{post.author}</p>
      <p>{post.description}</p>
      <p>{post.created_at}</p>
    </div>
  );
};

export default DetailPost;
